uniform float iTime;
uniform vec2 iResolution;
uniform vec4 iMouse;
uniform sampler2D iChannel0;

// Parameter mappings
uniform float u_speed;
uniform float u_scale;
uniform float u_intensity;
uniform float u_color_cycle;
uniform float u_layers;

out vec4 fragColor;

// --- Helper Functions ---

// 2D Rotation Matrix
mat2 rot(float a) {
    float s = sin(a), c = cos(a);
    return mat2(c, -s, s, c);
}

// Pseudo-random hash
float hash(vec2 p) {
    p = fract(p * vec2(123.34, 456.21));
    p += dot(p, p + 45.32);
    return fract(p.x * p.y);
}

// Lush Palette (Purples, Golds, Pinks)
vec3 palette(float t) {
    vec3 a = vec3(0.5, 0.5, 0.5);
    vec3 b = vec3(0.5, 0.5, 0.5);
    vec3 c = vec3(1.0, 1.0, 1.0);
    vec3 d = vec3(0.50, 0.20, 0.25);
    return a + b * cos(6.28318 * (c * t + d));
}

// Fine Dust Function
// Creates tiny distinct specks instead of cloudy noise
float getDust(vec2 uv, float t) {
    // 1. Gridify the space into tiny cells (high number = finer dust)
    float gridSize = 80.0; 
    vec2 id = floor(uv * gridSize);
    vec2 f = fract(uv * gridSize);

    // 2. Get random value per cell
    float r = hash(id);

    // 3. Random position for the dust mote within the cell
    vec2 pos = vec2(r, fract(r * 22.34));

    // 4. Distance from current pixel to the dust mote
    float d = distance(f, pos);

    // 5. Draw the dot
    // "size" varies with time to make them twinkle
    float size = 0.25 * (0.5 + 0.5 * sin(t * 3.0 + r * 10.0));

    // Smooth circle
    float spark = smoothstep(size, size * 0.1, d);

    // Randomize brightness so not all are uniform
    return spark * r; 
}

void main() {
    // 1. Correct Aspect Ratio UVs
    vec2 uv = (gl_FragCoord.xy - 0.1
 * iResolution.xy) / iResolution.y;
    vec2 uv0 = uv;

    // 2. Timing
    float spd = (u_speed <= 0.0) ? 0.2 : u_speed;
    float t = iTime * spd;

    // --- Background (Lush Purple Gradient) ---
    vec3 bgTop = vec3(0.25, 0.0, 0.35); // Deep Purple
    vec3 bgBottom = vec3(0.05, 0.02, 0.15); // Dark Indigo

    // Subtle background movement
    bgTop += 0.02 * sin(t * 0.3);

    vec3 finalColor = mix(bgBottom, bgTop, uv0.y + 0.5 + 0.1 * sin(t * 0.2));

    // 3. Layer Loop
    float density = (u_layers <= 0.0) ? 4.0 : u_layers;
    float scale = (u_scale <= 0.0) ? 1.0 : u_scale;
    float brightness = (u_intensity <= 0.0) ? 1.5 : u_intensity;

    for(float i = 0.0; i < 6.0; i++) {
        if(i >= density) break;

        // --- Space Distortion for the Main Line ---
        vec2 lineUV = uv0 * (1.0 + scale * 0.5);
        // Rotate and twist
        lineUV *= rot(t * 0.1 + i * 0.8);

        // Wave Calculation (The "Swing")
        float movement = sin(lineUV.y * 2.0 + t + i) * 0.5;
        movement += cos(lineUV.x * 1.0 - t + i * 1.5) * 0.5;

        // Distance to the center of the neon line
        float dist = abs(lineUV.x + movement);

        // --- Main Line Glow ---
        float coreGlow = exp(-dist * 12.0); // Sharp brightness
        float softGlow = exp(-dist * 3.0) * 0.4; // Soft halo

        // --- Fine Sprinkle Dust Logic ---

        // We distort the dust coordinates slightly differently than the line.
        // multiplying movement by 0.7 makes the dust "lag" behind the line physically.
        vec2 dustUV = lineUV;
        dustUV.x += movement * 0.7; 

        // Add a "flow" so dust drifts sideways
        dustUV.x -= t * 0.2; 
        dustUV.y += t * 0.05; // Slight rise

        // Get the fine dust pattern
        float specks = getDust(dustUV + vec2(i*10.0, i*5.0), t);

        // --- Spray Physics Mask ---
        // We want the dust to be dense near the line, and fade out as it sprays away.
        // The 'dist' variable is distance to the line.
        // We allow the dust to exist a bit further out than the glow.
        float sprayMask = exp(-dist * 2.0); // Slow fade out

        // Combine specks with the mask
        float dust = specks * sprayMask * 2.0;

        // 4. Coloring
        vec3 col = palette(length(uv0) * 0.5 + i * 0.3 + t * u_color_cycle);

        // Dust color: mix the neon color with gold/white for sparkle
        vec3 dustCol = mix(col, vec3(1.0, 0.95, 0.8), 0.7);

        // Accumulate: Line Glow + Fine Dust
        finalColor += col * (coreGlow + softGlow) * brightness * 0.4;
        finalColor += dustCol * dust * brightness;
    }

    // 5. Post-Processing
    float vig = 1.0 - length(uv0) * 0.4;
    finalColor *= vig;

    // Smooth Clamp / Tone Mapping
    finalColor = smoothstep(-0.05, 1.4, finalColor);

    fragColor = vec4(finalColor, 1.0);
}
